class Solution {
    public long continuousSubarrays(int[] nums) {
        long count = 0;
        int start = 0; // Start of the window
        int end = 0; // End of the window

        while (start < nums.length && end < nums.length) {
            boolean valid = true;
            int max = nums[start];
            int min = nums[start];
            // Expand the window to the right as far as it remains valid
            for (int i = start; i <= end; i++) {
                if (nums[i] > max) max = nums[i];
                if (nums[i] < min) min = nums[i];
                // If the window becomes invalid, break
                if (max - min > 2) {
                    valid = false;
                    break;
                }
            }

            if (valid) {
                // If the window is valid, count the new subarrays it introduces.
                count += end - start + 1;
                end++; // Expand the window to the right
            } else {
                start++; // Shift the window rightwards to try to regain validity
            }
        }

        return count;
    }
}
